import React from 'react'

export default (props) => {

	function hideAll(){
		{
			document.getElementsByClassName('Profilefoto').style.display = 'none'
		}
	}

	return(
	<div className="Profile">

			<div className="Profilefoto" onClick={hideAll()}></div>

			<div className="ProfileText">
				<h2>{props.nome}</h2>
				<p>{props.text}</p>
				<br/><br/>
				<span>doe bitcoin:</span><br/>
				<span>{props.bitcoin}</span>
			</div>
	</div>
	
	)
}
